import React from 'react';

export default function Register() {
  return (
    <div className="main-container">
      <div className="card">
        <h2>Create Account</h2>
        <form>
          <input type="text" placeholder="Name" required style={{width:'100%',marginBottom:'12px',padding:'10px'}} />
          <input type="email" placeholder="Email" required style={{width:'100%',marginBottom:'12px',padding:'10px'}} />
          <input type="password" placeholder="Password" required style={{width:'100%',marginBottom:'12px',padding:'10px'}} />
          <button type="submit" className="create-btn">Register</button>
        </form>
      </div>
    </div>
  );
}
